import React from 'react';
import "../assets/css/innerstyle.css";
import "../assets/css/compeounder.css";
const Commitment = () => {
  return (
    <section className="commitment">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="innerHeading text-center">
              <h2>Commitment</h2>
            </div>
            <div className="aboutContent text-center">
              <p>
                We are committed to breaking down the walls that prevent easy access to medical information
                and services. By prioritizing affordability, timeliness, and user-centric design, we aim to
                revolutionize the way healthcare information is accessed and utilized, ensuring that
                everyone has the opportunity to lead a healthier life.
              </p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Commitment;
